  let snss = [
    {img: './i-instagram.svg'},
    {img: './i-facebook.svg'},
    {img: './i-youtube.svg'},
    {img: './i-bog.svg'},
  ]
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
